funcSearch:
function funcSearch() {
  const els = window["time-grid"].children;
  const result = [];
  const dictCourse = {
    FORET: "Foret",
    ROYAL: "Royal",
  };
  Array.from(els).forEach((el) => {
    if (el.children.length < 2) return;
    const date = "20" + el.children[0].innerText.split("/").join("");
    const time = el.children[1].innerText.split(":").join("");
    const course = el.children[2].innerText;
    console.log("reserve search", dictCourse[course], date, time);
    result.push({ date, time, course: dictCourse[course] });
  });
  const param = {
    command: "SUCCESS_OF_RESERVE_SEARCH",
    golf_club_id: "08a3198e-c009-11ec-a93e-0242ac11000a",
    device_id: "${deviceId}",
    result,
  };
  const addr = OUTER_ADDR_HEADER + "/api/reservation/newReserveSearch";
  post(addr, param, { "Content-Type": "application/json" }, (data) => {
    console.log(data);
    logParam.message = "end of reserve/search";
    TZLOG(logParam, (data) => {
      log(data);
      if (ac) ac.message("end of reserve/search");
      doLogout();
    });
  });
}
